  // const { data: featuredTours, loading, error } 
  // = useFetch(`${BASE_URL}/tours/search/getFeaturedTours`
  // );
  
  // console.log(featuredTours);
  
  return (
    <>  
        {/* {loading && <h4>Loading.....</h4>}
        {error && <h4>{error}</h4>} */}
        {tourData?.map(tour => (
            <Col lg='3' className='mb-4' key={tour._id}>
